import React from "react";
import "./Coupon.css";

const Coupon = () => {
  return (
    <>
      <div className="directions">
        Click to spin the wheel to see what prize you won!
      </div>
      <div className="spin-the-wheel">
        <label>
          <input type="radio" />
          <div className="clicker"></div>
          <div className="wheel">
            <div className="option o1">five kisses</div>
            <div className="option o2">four dabloons</div>
            <div className="option o3">i take u out and u choose the place :3</div>
            <div className="option o4">unlimited hugs n kisses</div>
            <div className="option o5">A New Clipper Card!</div>
          </div>
          <div className="message">
            You won a new clipper card! <br />
            Click to claim your prize.
          </div>
          <a href="http://votion.co" target="_blank"></a>
        </label>
      </div>
    </>
  );
};

export { Coupon };
